import { useParams } from "react-router-dom";
import EventForm from "../"

export default function EditEventPage() {
  const param = useParams();
  return (
    <>
    <EventForm />
      <h1 style={{ font: "2rem", color: "white" }}>
        Edit Page
        <h1>eventId {param.eventId}</h1>
      </h1>
    </>
  );
}
